import { Card } from "react-bootstrap";

const ForumCard = ({ title, content }) => {
  return (
    <Card>
      <Card.Img variant="top" src="../static/img/img01.jpg" />
      <Card.Body>
        <Card.Title>{title}</Card.Title>
        <Card.Text>{content}</Card.Text>
      </Card.Body>
    </Card>
  );
};

export default ForumCard;
